column8:
グレーが長期欠品中、次回入荷日は未定です。<br>
<br>
軽自動車からトラックまで車種を選ばず、ほとんどの運転席・助手席に装着可能です。<br>
高反発ウレタン採用のサイドサポートと立体感のある凹凸のデザインで長時間の運転をサポートします。<br>
スポーツシューズ等に用いられる特殊メッシュ生地に難燃性処理を施し、優れた通気性と安全性を実現しました。よって一年を通して快適にご使用いただけます。<br>
<br>
座席正面よりカバーを覆い被せてゴム紐で固定するだけの簡単装着。<br>
アームレスト付きやベンチシートなどのシートには装着できません。<br><style type="text/css">
